import React from "react";
import CardsInLeftContent from "./CardsInLeftContent/CardsInLeftContent";
import RightContentForm from "./RightContentForm/RightContentForm";
import arrowLeft from "../../img/arrowLeft.png";
import dots from "../../img/dots.png";
import styles from "./styles/index.css";

const InfoForm = () => {
  return (
    <div>
      <div lassName="Container">
        <img src={arrowLeft} alt="arrowLeft " className="arrowLeft" />
        <div className="textContainer">
          <span className="textSettings">Account Settings</span>
        </div>
        <img src={dots} alt="dots " className="dots" />
        <span className="text">
          View and update your account profile, communication preferences, and
          more.
        </span>
      </div>
      <CardsInLeftContent />
      <RightContentForm />
    </div>
  );
};

export default InfoForm;
